import React, { useEffect, useState } from "react";
import axios from "axios";
import { TodoType } from "./todo";
import { useParams } from "react-router-dom";
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";
import { format } from "date-fns";
const Updated = () => {
  const { id } = useParams();
  const [data, setData] = useState<TodoType | null>(null);
  const [newTodo, setNewTodo] = useState({
    kullaniciAd: "",
    kullaniciSoyad: "",
    kullaniciEmail: "",
    yasadigiSehir: "",
    adress: "",
    city: "",
    province: "",
    postaCode: "",
    planing: null,
    planingEnd: null,
  });

  const fetchData = async () => {
    try {
      await axios
        .get(`http://localhost:9363/post/detay/${id}`)
        .then((response) => {
          setData(response.data);
          console.log(setData);
        });
    } catch (error) {}
  };
  useEffect(() => {
    fetchData();
  });


  const handleInputChange = (event:any) => {
    const { name, value } = event.target;
    setNewTodo({ ...newTodo, [name]: value });
  };
  const handleDateChange = (date:any) => {
   const formattedDate: any = format(date, "yyyy-MM-dd");

    setNewTodo({ ...newTodo, planing: formattedDate });


  };

      const handleFormSubmit = async (e:any) => {
        e.preventDefault();
        try {
          const response = await axios.put(`http://localhost:9363/post/panel/duzenle/${id}`, {
            ...newTodo,
          });

          if (response.status === 200) {
            setNewTodo({
              kullaniciAd: "",
              kullaniciSoyad: "",
              kullaniciEmail: "",
              yasadigiSehir: "",
              adress: "",
              city: "",
              province: "",
              postaCode: "",
              planing: null,
              planingEnd: null,
            });
          } else {
            console.error(
              "Failed to make POST request. Server responded with status:",
              response.status
            );
          }
        } catch (error) {
          console.log(error);
        }
      };
  return (
    <>
      <form>
        <div className="space-y-10 p-4 bg-gray-800">
          <div className="border-b border-gray-900/10 pb-12">
            <h2 className="text-base font-semibold leading-7 text-white">
              Personal InhtmlFormation
            </h2>
            <p className="mt-1 text-sm leading-6 text-white">
              Use a permanent address where you can receive mail.
            </p>
             <form onSubmit={handleFormSubmit}>


            <div className="mt-10 grid grid-cols-1 gap-x-6 gap-y-8 sm:grid-cols-6">
              <div className="sm:col-span-2">
                <label
                  htmlFor="first-name"
                  className="block text-sm font-medium leading-6  text-white"
                >
                  First name
                </label>
                <div className="mt-2">
                  <input
                    type="text"
                    name="kullaniciAd"
                    value={data?.kullaniciAd}
                    onChange={handleInputChange}
                    id="first-name"
                    className="block w-full rounded-md border-0 py-1.5 bg-gray-800 text-gray-400 pl-1 shadow-sm ring-1 ring-inset ring-gray-500 placeholder:text-gray-400 focus:ring-2 focus:ring-inset focus:ring-indigo-600 sm:text-sm sm:leading-6"
                  />
                </div>
              </div>

              <div className="sm:col-span-2">
                <label
                  htmlFor="last-name"
                  className="block text-sm font-medium leading-6  text-white"
                >
                  Last name
                </label>
                <div className="mt-2">
                  <input
                    type="text"
                    name="kullaniciSoyad"
                    value={data?.kullaniciSoyad}
                    onChange={handleInputChange}
                    id="last-name"
                    className="block w-full rounded-md border-0 py-1.5 bg-gray-800 text-gray-400 pl-1 shadow-sm ring-1 ring-inset ring-gray-500 placeholder:text-gray-400 focus:ring-2 focus:ring-inset focus:ring-indigo-600 sm:text-sm sm:leading-6"
                  />
                </div>
              </div>

              <div className="sm:col-span-2">
                <label
                  htmlFor="email"
                  className="block text-sm font-medium leading-6  text-white"
                >
                  Email address
                </label>
                <div className="mt-2">
                  <input
                    id="email"
                    name="kullaniciEmail"
                                        value={data?.kullaniciEmail}
                                        onChange={handleInputChange}
                    type="email"
                    className="block w-full rounded-md border-0 py-1.5 shadow-sm ring-1 bg-gray-800 text-gray-400 pl-1 ring-inset ring-gray-500 placeholder:text-gray-400 focus:ring-2 focus:ring-inset focus:ring-indigo-600 sm:text-sm sm:leading-6"
                  />
                </div>
              </div>

              <div className="sm:col-span-3">
                <label
                  htmlFor="country"
                  className="block text-sm font-medium leading-6  text-white"
                >
                  Country
                </label>
                <div className="mt-2">
                <select
                                        id="country"
                                        name="yasadigiSehir"
                                        value={data?.yasadigiSehir}
                                        onChange={handleInputChange}
                                        autoComplete="country-name"
                                        className="pl-1 block w-full rounded-md border-0 py-1.5 text-gray shadow-sm ring-1 ring-inset  placeholder:text-gray-400 focus:ring-2 focus:ring-inset focus:ring-indigo-600 sm:text-sm sm:leading-6"
                                      >
                                        <option value="United States">
                                          United States
                                        </option>
                                        <option value="Canada">Canada</option>
                                        <option value="Mexico">Mexico</option>
                                      </select>
                </div>
              </div>

              <div className="sm:col-span-3 ">
                <label
                  htmlFor="street-address"
                  className="block text-sm font-medium leading-6  text-white"
                >
                  Street address
                </label>
                <div className="mt-2">
                  <textarea
                    id="about"
                    name="adress"
                    value={data?.adress}
                    onChange={handleInputChange}
                    className="
                 pl-1 bg-gray-800 ring-gray-500
                block w-full rounded-md border-0 py-1.5 text-gray-500 shadow-sm ring-1 ring-inset  placeholder:text-gray-400 focus:ring-2 focus:ring-inset focus:ring-indigo-600 sm:text-sm sm:leading-6"
                  ></textarea>
                </div>
              </div>

              <div className="sm:col-span-3 ">
                <label
                  htmlFor="city"
                  className="block text-sm font-medium leading-6  text-white"
                >
                  City
                </label>
                <div className="mt-2">
                  <input
                    type="text"
                    name="city"
                    value={data?.city}
                    onChange={handleInputChange}
                    id="city"
                    className="block w-full rounded-md border-0 py-1.5 bg-gray-800 text-gray-400 pl-1 shadow-sm ring-1 ring-inset ring-gray-500 placeholder:text-gray-400 focus:ring-2 focus:ring-inset focus:ring-indigo-600 sm:text-sm sm:leading-6"
                  />
                </div>
